/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap, unsafeHTML, setTags, setSuffix } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-avatar-group-root"><div class="ui5-avatar-group-items" @keyup="${context._onkeyup}" @keydown="${context._onkeydown}" @focusin="${context._onfocusin}" tabindex="${ifDefined(context._groupTabIndex)}" @click="${context._onGroupClick}" @ui5-click="${ifDefined(context._onUI5Click)}"><slot></slot><ui5-button ?hidden="${context._overflowBtnHidden}" tabindex="${ifDefined(context._overflowButtonTabIndex)}" class="ui5-avatar-group-overflow-btn">${ifDefined(context._overflowButtonText)}</ui5-button></div></div>`; };


const main = (context, tags, suffix) => {
	setTags(tags);
	setSuffix(suffix);
	return block0(context);
};

export default main;
